tables.table_schema:
CREATE TABLE QuantumCircuits (
    circuit_id SERIAL PRIMARY KEY,
    algorithm_name VARCHAR(50) NOT NULL,
    qubit_count INT NOT NULL,
    gate_type VARCHAR(20) NOT NULL
);

CREATE TABLE QuantumAlgorithms (
  algorithm_id INT PRIMARY KEY,
  algorithm_name VARCHAR(50),
  circuit_configuration JSON
);

CREATE TABLE quantum_circuits (
  circuit_id UUID PRIMARY KEY,
  circuit_name TEXT NOT NULL,
  algorithm_name TEXT NOT NULL,
  qubit_count INT NOT NULL
);

CREATE TABLE qubits (
  qubit_id UUID PRIMARY KEY,
  qubit_name TEXT NOT NULL,
  qubit_state TEXT NOT NULL
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    circuit_description TEXT
);

CREATE TABLE quantum_gates (
    gate_id INT PRIMARY KEY,
    gate_name VARCHAR(50),
    qubit_count INT,
    gate_type VARCHAR(50)
);

CREATE TABLE circuit_instructions (
    instruction_id INT PRIMARY KEY,
    algorithm_id INT,
    gate_id INT,
    instruction_order INT
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    qubit_name VARCHAR(50),
    qubit_value VARCHAR(1)
);

CREATE TABLE quantum_circuits (
    circuit_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    num_qubits INT,
    gate_operations JSON
);

CREATE TABLE algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255) UNIQUE,
    description TEXT
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    qubit_name VARCHAR(255),
    qubit_state VARCHAR(10)
);

CREATE TABLE gate_operations (
    gate_id INT PRIMARY KEY,
    gate_name VARCHAR(50),
    operation_description TEXT,
    operation_cost REAL
);

CREATE TABLE circuit_operations (
    operation_id INT PRIMARY KEY,
    circuit_id INT,
    gate_id INT,
    qubit_id INT
);
